import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "./Pages/Home";

const Layout = () => {
  return;
  <BrowserRouter>
    <Routes>
      <Route path="/" Component={<Home />} />
    </Routes>
  </BrowserRouter>;
};

export default Layout;
